import Axios from 'axios';
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';


Axios.defaults.baseURL = 'http://localhost:3000/';

ReactDOM.render(
  <React>
    <App />
  </React>,
  document.getElementById('root')
);
